import React from "react";
import { Container } from "react-bootstrap";
import '../App.css';

function Report() {
    return (
        <>
            <Container>
                <h1>Report an Infection</h1>
                <a  style={{fontSize:33,color:'white'}}>

                    Hello! This is the report page!
                </a>
            </Container>
        </>
    );
}

export default Report;
